sys_variable_value.value:
(function execute(inputs, outputs) {
  var responseBody = JSON.parse(inputs.response_body);
  if(inputs.status_code == "200") {
  	outputs.status = "Success";
    outputs.name = responseBody.name;
    outputs.valid_after_time = responseBody.validAfterTime;
    outputs.valid_before_time = responseBody.validBeforeTime;
    outputs.key_algorithm = responseBody.keyAlgorithm;
    outputs.key_origin = responseBody.keyOrigin;
  } else {
  	outputs.status = "Error";
    outputs.error_message = new GoogleIdentityAccessErrorHandler().handleError(responseBody.error); 
  }
})(inputs, outputs);

