sys_variable_value.value:
(function execute(inputs, outputs) {
  var allowedPatternForProjectID = /[a-z0-9-]/g;
  if (!allowedPatternForProjectID.test(inputs.idOfProject)) {
    throw new Error("Name of the project is in /[a-z0-9-]/g format : " + inputs.idOfProject);
  }  
})(inputs, outputs);

